import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './components/Home';
import About from './components/About';
import Services from './components/Services';

import './App.css';
import RecentActions from './components/RecentActions';
import SignInSide from './components/SignInpg';
function App() {
  return (
    <Router>
      <div className="heading">What Do you Want to search</div>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Sign in </Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/services">Services</Link>
            </li>
            <li>
              <Link to="/RecentActions">RecentActions</Link>
            </li>
            <li>
              <Link to="/User">RecentActions</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<SignInSide />} />
          <Route path="/about" element={<About />} />
          <Route path="/services" element={<Services />} />
          <Route path="/RecentActions" element={<RecentActions />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
